import React from 'react';
import Terminal from 'react-console-emulator';

const commands = {
  echo: {
    description: 'Echo a passed string.',
    usage: 'echo <string>',
    fn() {
      // eslint-disable-next-line prefer-rest-params
      return `${Array.from(arguments).join(' ')}`;
    },
  },
  about: {
    description: 'about me and this place.',
    usage: 'about',
    fn() {
      // eslint-disable-next-line prefer-rest-params
      return "Hi. I'm Aydin. I'm a front-end developer.If you need something, you can directly ask for the information you need, the good ol CLI way.";
    },
  },
  contact: {
    description: 'Find a way to contact me',
    usage: 'contact',
    fn() {
      return (
        <>
          <a onClick={con} href="www.google.com" target="blank">
            Email: dindavut14@gmail.com
          </a>
          <br />
          <p> Davut97</p>
        </>
      );
    },
  },
};

const MyTerminal = () => {
  return (
    <Terminal
      commands={commands}
      welcomeMessage="Welcome to the React terminal!"
      promptLabel="me@React:~$"
    />
  );
};
export default MyTerminal;
